drop database testDBMS;
create database testDBMS;
use testDBMS;

create table `station`(
  `s_id` varchar(10) NOT NULL PRIMARY KEY,
  `name` varchar(100) NOT NULL,
  `address` varchar(50) NOT NULL,
  `status` varchar(20) NOT NULL DEFAULT 'ACTIVE'
);



create table `officer`(
  `o_id` varchar(10) NOT NULL PRIMARY KEY,
  `name` varchar(100) NOT NULL,
  `gender` varchar(10) NOT NULL,
  `email` varchar(100) NOT NULL,
  `phone` varchar(20) NOT NULL,
  `password` varchar(20) NOT NULL,
  `address` varchar(50) NOT NULL,
  `designation` varchar(50) NOT NULL,
  `status` varchar(20) NOT NULL DEFAULT 'NEW',
  `s_id` varchar(10) NOT NULL,
  constraint `officer_s_id_fk` foreign key (`s_id`) references `station`(`s_id`)
);



create table `victims`(
  `v_id` varchar(10) NOT NULL PRIMARY KEY,
  `name` varchar(100) NOT NULL,
  `gender` varchar(10) NOT NULL,
  `aadhar_id` bigint NOT NULL,
  `email` varchar(100) NOT NULL,
  `phone` varchar(20) NOT NULL,
  `password` varchar(20) NOT NULL,
  `address` varchar(50) NOT NULL,
  `age` varchar(10) NOT NULL
);






CREATE TABLE `complaint` (
  `c_id` varchar(10) NOT NULL,
  `v_id` varchar(10) NOT NULL,
  `o_id` varchar(10) NOT NULL,
  `category` varchar(36) NOT NULL,
  `details` varchar(500) NOT NULL,
  `datetime` date NOT NULL,
  `suspect` varchar(100) NOT NULL,
  `address` varchar(50) NOT NULL,
  `status` varchar(20) NOT NULL DEFAULT 'NEW',
  `priority` varchar(20) NOT NULL DEFAULT 'MEDIUM',
  `bureau_notes` varchar(400) NOT NULL,

  constraint `complaint_pk` primary key (`c_id`) ,
  constraint `complaint_fk_1` foreign key (`v_id`) references `victims` (`v_id`),
  constraint `complaint_fk_2` foreign key (`o_id`) references `officer` (`o_id`)
) ;



CREATE TABLE `logs` (
  `id` int NOT NULL,
  `action` varchar(500) NOT NULL,
  `cdate` datetime NOT NULL,
   `c_id` varchar(20) NOT NULL,

   constraint `logs_pk` primary key (`id`),
   constraint `logs_fk` foreign key (`c_id`) references `complaint` (`c_id`)
);

